import React, { Component, Fragment } from "react";

import NavBar from "../NavBar";

const styles = {
  root: {
    flexGrow: 1
  },
  grow: {
    flexGrow: 1
  },
  menuButton: {
    marginLeft: -12,
    marginRight: 20
  }
};

class Header extends Component {
  render() {
    return (
      <Fragment>
        <NavBar />
      </Fragment>
    );
  }
}

export default Header;
